import React from 'react';

const Cart = (props) => {
    const {} = props.cart ;

    let totalBudget = 0 ;
    for (let i = 0; i < cart.length; i++) {
        let player = cart[i];
        totalBudget += player.salary;
        
    }
    return (
        <div>
            <h1>cart : {cart.length}</h1>
            <p>name :{cart.name}</p>
            <p>Total Budget = {totalBudget}</p>
            
        </div>
    );
};

export default Cart;
